"<!ELEMENT CSPROFILE (CSPROFILEHDR, CSPROFILEPARAMS, CSPROFILETREE)>\n<!ATTLIST CSPROFILE\n       version CDATA #REQUIRED>\n  <!ELEMENT CSPROFILEHDR (#PCDATA)>\n  <!ELEMENT CSPROFILEPARAMS (TARGET, METRIC)>\n    <!ELEMENT TARGET EMPTY>\n    <!ATTLIST TARGET\n         name CDATA #REQUIRED>\n    <!ELEMENT METRIC EMPTY>\n    <!ATTLIST METRIC\n         shortName   CDATA #REQUIRED\n         nativeName  CDATA #REQUIRED\n         period      CDATA #REQUIRED\n         units       CDATA #IMPLIED\n         displayName CDATA #IMPLIED\n         display     (true|false) #IMPLIED>\n  <!ELEMENT CSPROFILETREE (PGM)*>\n    <!ELEMENT PGM (G|CALLSITE)+>\n    <!ATTLIST PGM\n	    n CDATA #REQUIRED>\n    <!ELEMENT G (G|CALLSITE|L|S)*>\n    <!ATTLIST G\n	    n CDATA #IMPLIED>\n    <!ELEMENT CALLSITE (G|CALLSITE|L|S)*>\n    <!ATTLIST CALLSITE\n	    f CDATA #IMPLIED\n	    p CDATA #IMPLIED\n	    l CDATA #IMPLIED\n	    c CDATA #IMPLIED>\n    <!ELEMENT L (G|L|S)*>\n    <!ATTLIST L\n	    b CDATA #IMPLIED\n	    e CDATA #IMPLIED>\n    <!ELEMENT S EMPTY>\n    <!ATTLIST S\n	    b CDATA #REQUIRED\n	    e CDATA #IMPLIED\n	    id CDATA #IMPLIED>\n";
